import React from 'react';
import { Card, Paper, makeStyles } from '@material-ui/core';
import { Autorenew } from '@material-ui/icons';
import { Typography } from '@material-ui/core';
import { Divider } from '@material-ui/core';
import { spacing } from '@material-ui/system';

const useStyles = makeStyles(() => ({
    paper: {
        marginTop: '100px',
        marginBottom: '50px',
        margin: 'auto',
        width: '75%',
        padding: '10px',
    }
}));

const InvalidPage = () => {
    const { paper } = useStyles();
    return (
        <div>
            <Paper className={paper} variant='outlined' elevation={0}>
                <Typography variant="h4" gutterBottom>
                    <strong>This page could not be found!</strong>
                </Typography>
                <Typography variant="h3" gutterBottom>
                    <strong>Rules & Regulations For The Chess Tournament</strong>
                </Typography>
                <h1>This page could not be found!</h1>
                <h2>The page you requested could not be found. Please make sure you have typed the correct URL.</h2>
            </Paper>
        </div>
    );
}

export default InvalidPage;
